import React from 'react';

function footer () {
    return (
        <nav className='Navbar'>
            <img className='logo' src={logo} alt=""></img>
            <ul>
                <li>Home</li>
                <li>About Us</li>
                <li>Book Appointment</li>
                <li>Login</li>
            </ul>
        </nav>
    )
}

export default Footer;
